import React from 'react';
import SliderItem from './slider.component';

const SliderList = (props) => {
  return (
    <div>
      {props.slider.map((sliders) => {
        <SliderItem sliders={sliders} key={sliders.id} />;
      })}
    </div>
  );
};

export default SliderList;
